import 'bootstrap';
import './dropdown.css';
import { removeFile } from '../../../../actions/file';

const Dropdown = (props) => {
    const clickHandler = (file) => {
        // removeFile(file);
        console.log(file);
    }
    return (
        <div>
            <div className="Dropdown-container" style={{top: props.Y, left: props.X, opacity: props.opacity}}>
                        <span className="dropdown-item">
                            Rename
                        </span>
                        {/* <div className="dropdown-divider"></div> */}
                        <span className="dropdown-item">
                            Download
                        </span>
                        <span
                            className="dropdown-item"
                            style={{color: '#ff1f48'}}
                            onClick={() => clickHandler(props.file)}
                            >Remove
                        </span>
            </div>
        </div>
    )
}

export default Dropdown
